function scale3d(vertices, scales){
const scaledVertices = vertices.map(([x, y, z]) => [
        x * scales[0],
        y * scales[1],
        z * scales[2]
    ]);

  return scaledVertices

  
}

function translate3d(vertices, distances){
const translatedVertices = vertices.map(([x, y, z]) => [
        x + distances[0],
        y + distances[1],
        z + distances[2]
    ]);

  return translatedVertices

  
}

function rotate3d(vertices, angles) {
    const [angleX, angleY, angleZ] = angles;

    // Step 1: Calculate the center of the object
    const centerX = vertices.reduce((sum, [x]) => sum + x, 0) / vertices.length;
    const centerY = vertices.reduce((sum, [, y]) => sum + y, 0) / vertices.length;
    const centerZ = vertices.reduce((sum, [, , z]) => sum + z, 0) / vertices.length;

    // Step 2: Translate vertices to center
    const translatedVertices = vertices.map(([x, y, z]) => [
        x - centerX,
        y - centerY,
        z - centerZ
    ]);

    // Step 3: Perform rotations around the X, Y, and Z axes
    const radiansX = angleX * (Math.PI / 180);
    const radiansY = angleY * (Math.PI / 180);
    const radiansZ = angleZ * (Math.PI / 180);

    const cosX = Math.cos(radiansX);
    const sinX = Math.sin(radiansX);
    const cosY = Math.cos(radiansY);
    const sinY = Math.sin(radiansY);
    const cosZ = Math.cos(radiansZ);
    const sinZ = Math.sin(radiansZ);

    const rotatedVertices = translatedVertices.map(([x, y, z]) => {
        // Rotate around Z
        let newX = cosZ * x - sinZ * y;
        let newY = sinZ * x + cosZ * y;
        let newZ = z;

        // Rotate around Y
        x = newX;
        y = newY;

        newX = cosY * x + sinY * z;
        newY = y;
        newZ = -sinY * x + cosY * z;

        // Rotate around X
        x = newX;
        y = newY;

        newX = x;
        newY = cosX * y - sinX * z;
        newZ = sinX * y + cosX * z;

        return [newX, newY, newZ];
    });

    // Step 4: Translate back to original position
    return rotatedVertices.map(([x, y, z]) => [
        x + centerX,
        y + centerY,
        z + centerZ
    ]);
}

function project3d(vertices, focalLenght){

const projectedVertices = [];

vertices.forEach(vertex => {
  const x=vertex[0]
  const y=vertex[1]
  const z=vertex[2]
  let xProjected, yProjected;
  if(z==0){
  xProjected = x
  yProjected = y
  }
  else {
  xProjected = -(focalLenght * x) / z
  yProjected = (focalLenght * y) / z}
  
  
  projectedVertices.push([xProjected,yProjected]);
});
return projectedVertices
}

